import React from "react";

const ImageList = (props) => {
  const images = props.images.map((image) => {
    console.log(image);
    return <img src={image.urls.regular} />;
  });

  return <div style={{ width: "100px", height: "100px" }}> {images} </div>;
};

export default ImageList;
